import React from 'react';
import { Link } from "react-router-dom";

const Header = (props) => {
    return (
        <Link to={'/'}>
            <div className="row">
                <div className="col-12 dulces justify-content-center d-flex">
                    <p className="text-white">Dulces Meriendas </p>
                </div>

            </div>
        </Link>
    )

}
export default Header;
